import React from 'react';

const EarnerDashboard = ({ onLogout }) => {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Earner Dashboard</h1>
      <p>Coming Soon...</p>
      <button onClick={onLogout} style={{ padding: '10px 20px', background: '#4a6cfa', color: 'white', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
        Logout
      </button>
    </div>
  );
};

export default EarnerDashboard;
